function isValidString(word){
	
	var letterFrec=frecuencyExtractor(stringIterator(word)),
	frecOfFrec=frecuencyExtractor(frecuencyObjectIterator(letterFrec)),
	regularPosOccuped=0,
	sparePosOccuped=0;
	
	//console.log(letterFrec);
	//console.log(frecOfFrec);
	for (var property in frecOfFrec) {
		if (frecOfFrec.hasOwnProperty(property)) {
			if(frecOfFrec[property]>1){
				regularPosOccuped++;
			}
			else if(frecOfFrec[property]==1){
				sparePosOccuped++;
			}
			
			if(regularPosOccuped>1 && sparePosOccuped>1){
				break;
			}
		}
	}
	
	if(regularPosOccuped>1 || sparePosOccuped>1){
		console.log("NO");
	}
	else{
		console.log("YES");
	}
	
	function frecuencyExtractor(iterator){
		
		var current=iterator.next(),
		result={};
		
		while(current!==undefined){
			if(result[current]===undefined){
				result[current]=0;
			}
			result[current]++;
			current=iterator.next();						
		}
		
		return result;
	}
	
	function stringIterator(strWord){
		var currentPos=0;
		
		
		return {
			next:function(){
				if(currentPos>=strWord.length){
					return undefined;
				}
				
				return strWord[currentPos++];
			}
		}
	}
	
	function frecuencyObjectIterator(frecObject){
		var result=[];
		
		for (var property in frecObject) {
			if (frecObject.hasOwnProperty(property)) {
				result.push(frecObject[property]);
			}
		}

		return stringIterator(result);
	}
}

isValidString("abbac");
isValidString("");
isValidString("hfchdkkbfifgbgebfaahijchgeeeiagkadjfcbekbdaifchkjfejckbiiihegacfbchdihkgbkbddgaefhkdgccjejjaajgijdkd");

isValidString("")
